import React from "react";

import SiteButton from "../UI/SiteButton";
import Header from "../Components/Header";
import Footer from "../Components/Footer";

import "../fonts/fonts.css";
import classes from "./Compose.module.css";
import classes2 from "./Nespresso.module.css";

const Nespresso = () => {
  return (
    <div className={classes.wrap}>
      <Header bgColor=" " titleColor="#ffffff" />

      <div
        className={classes2.subPageBanner}
        style={{ background: "url(images/sub_nespresso_banner.png)" }}
      >
        <div className={classes2.subBannerText}>
          <div className={classes2.subBannerTextLeft}>
            <p>작업기간</p>
            <p>기여도</p>
            <p>사용 프로그램</p>
          </div>
          <div className={classes2.subBannerTextRight}>
            <p>2022.04 ~ 2022.05</p>
            <p>100%</p>
            <div className={classes2.subBannerTools}>
              <p
                style={{
                  background: "url(images/icon_photoshop.png) no-repeat",
                  backgroundSize: "100%",
                }}
              ></p>
              <p
                style={{
                  background: "url(images/icon_illustrator.png) no-repeat",
                  backgroundSize: "100%",
                }}
              ></p>
              <p
                style={{
                  background: "url(images/icon_xd.png) no-repeat",
                  backgroundSize: "100%",
                }}
              ></p>
              <p
                style={{
                  background: "url(images/icon_html5.png) no-repeat",
                  backgroundSize: "100%",
                }}
              ></p>
            </div>
          </div>
        </div>
        <SiteButton
          className={classes.composeBtn}
          btnColor="#d3391a"
          textColor="#ffffff"
          top="775px"
          left="370px"
          link="nespresso/index.html"
        />
      </div>

      <SiteButton
        className={classes.composeBtn}
        btnColor="#d3391a"
        textColor="#ffffff"
        width="452px"
        top="12100px"
        left="50%"
        link="nespresso/index.html"
        transX="-50%"
      />

      <Footer footerTop="12267px" />
      {/* <img src="images/nespresso.png" alt="네스프레소" /> */}
    </div>
  );
};

export default Nespresso;
